package practicas.GomezGarciaJoseAlberto_p1;

import jakarta.servlet.ServletContextEvent;
import jakarta.servlet.ServletContextListener;
import jakarta.servlet.annotation.WebListener;
import practicas.GomezGarciaJoseAlberto_p1.modelo.Producto;
import practicas.GomezGarciaJoseAlberto_p1.modelo.Usuario;
import practicas.GomezGarciaJoseAlberto_p1.services.ProductoServiceImpl;
import practicas.GomezGarciaJoseAlberto_p1.services.UsuarioServiceImpl;

@WebListener
public class MyServletContextListener implements ServletContextListener {

	private ProductoServiceImpl productoService = new ProductoServiceImpl();
	private UsuarioServiceImpl usuarioService = new UsuarioServiceImpl();

	
	@Override
    public void contextInitialized(ServletContextEvent sce) {
		//Cargar datos en la BD al inicio del server.
		try {
			productoService.add(new Producto(9029L, "Strike The Blood Novel Vol.1", 9.99, ""));
			productoService.add(new Producto(9030L, "The Witcher 3 (PC)", 29.99, ""));
			productoService.add(new Producto(9031L, "Samsung Galaxy Watch", 389.99, ""));
			productoService.add(new Producto(9032L, "Spy x Family Manga Vol.3", 7.99, ""));
		} catch (Exception e) {
			throw new RuntimeException(e);
		}

        try {
            usuarioService.add(new Usuario("admin", "admin", "ADMIN"));
            usuarioService.add(new Usuario("user", "user", "USER"));
        } catch (Exception e) {
            throw new RuntimeException(e);
        }

    }

	@Override
    public void contextDestroyed(ServletContextEvent sce) {
		// Esta funcin se ejecuta al cerrar el servidor.
		// Imagino que en un caso real se podra notificar a un admin o realizar alguna gestin del estilo.
	}
	
}
